import React from 'react';
import { View, FlatList } from 'react-native';

import styles from "./styles";

export default function MySearchBar({ placeholder, data }) {
    return (
        <View style={styles.container}>
            <View style={styles.searchInputs}>
                <input style={styles.input} type={"text"} placeholder={placeholder} />
                <View style={styles.searchIcon}></View>
            </View>
            <View style={styles.dataResults}>
                {data.map((value, key) => {
                  return <View> {value.quizName} </View>
                })}
            </View>
        </View>
    )
}
